import React from 'react';
import { auth } from '../services/firebase'
import Button from 'react-bootstrap/Button';
import Navbar from './Navbar';
import '../App.css';

const Home = ({ user }) => {
    return (
        <div className="home">
            <Navbar/>
            <h1>Welcome to our survey on human image recognition</h1>           
        </div>
    )
}

export default Home;
